import 'bootstrap/dist/css/bootstrap.css'
import { useEffect, useState } from 'react';
import Cartoon from './appComponents/rowCards';

const DATA_URL_RICK = "https://rickandmortyapi.com/api/character"

const DATA_URL_MORTY = "https://rickandmortyapi.com/api/character/?page=2"


function App() {

const [cardInfo, updateCards] = useState([])
const [pageInfo, updatePage] = useState([])

  useEffect(() => {

    fetch(DATA_URL_RICK)
    .then((result) => result.json())
    .then((result) => {
      updateCards(result.results)

    });

    }, [])


    useEffect(() => {

      fetch(DATA_URL_MORTY)
      .then((result) => result.json())
      .then((result) => {
        updatePage(result.results)

      });

      }, [])


  return (
    <div className="rmApp">
      <Cartoon data = {cardInfo} page = {pageInfo}/> 
    </div>
  );
}

export default App;
